export class SearchFormm extends Component {

    constructor(props){
        super(props)
        this.state = {
            query: ""
        }
    }

    render() {
        return (
            <div> 
                <input onChange= {()=>this.handleInputChange} type='text' name= 'query' value= {this.state.query} /> 
                <button>Search Movie</button>
            </div>
        )
    }
}
